func rob(root *TreeNode) int {
	if root == nil {
		return 0
	}
	selected, notSelected := dfs(root)
	if selected > notSelected {
		return selected
	}
	return notSelected
}

func dfs(n *TreeNode) (selected, notSelected int) {
	if n == nil {
		return selected, notSelected
	}
	// 深度遍历
	ls, lns := dfs(n.Left)
	rs, rns := dfs(n.Right)
	// f表示选择o节点，g表示不选择o节点
	// f(o) = g(l) + g(r)
	// g(o) = Max(g(l), f(l)) + Max(g(r), f(r))
	selected = n.Val + lns + rns
	notSelected = max(lns, ls) + max(rns, rs)
	return
}

