func robTwo(nums []int) int {
	/*
		分析子问题：
		如果只有一间房，它就是最大金额，
		如果有两间房，就是他们其中之一
		第一间房和最后一间房不能重叠，那么就是找如下两种情况：
		假设房子有n个：1，.....，n
		偷最后一个房子，就不能选第一个，偷取的范围是: 2, n
		偷第一个房子，就不能选最后一个，偷取的范围是: 1, n-1
		确定范围后，需要注意的是其他规律就是不能连续两间，那么如果子问题是k间房找最大值
		如果k间房不偷了最后一间，那么k间房的问题解是：
		f(k) = f(k-1)
		如果k间房偷最后一间，那么k间房的问题解是：
		f(k) = f(k-2) + nums[k-1]
		找到f(k) = Max(f(k-1), f(k-2) + nums[k-1])
	*/
	nLen := len(nums)
	if nLen == 0 {
		return nLen
	}
	if nLen == 1 {
		return nums[0]
	}
	// 偷第一个房子，范围是: 1, k-1
	pre, cur, tmp := 0, 0, 0
	for idx := 0; idx < nLen-1; idx++ {
		if pre+nums[idx] > cur {
			tmp = pre + nums[idx]
		} else {
			tmp = cur
		}
		pre = cur
		cur = tmp
	}
	pre, other := 0, 0
	for idx := 1; idx < nLen; idx++ {
		if pre+nums[idx] > other {
			tmp = pre + nums[idx]
		} else {
			tmp = other
		}
		pre = other
		other = tmp
	}

	if cur > other {
		return cur
	}

	return other
}

