func robOne(nums []int) int {
	if len(nums) == 0 {
		return 0
	}

	// 动态规划问题，先定义子问题
	// 有n个房子，可以先划分成k个房子
	// 如果是k个房子找最大值，那么最后一个房子是k-1
	// 如果要偷最后一个房子，问题就变成了 f(k-1)
	// 如果不偷最后一个房子，问题就变成了 f(k-2)
	// 最后就变成了 Max(f(k-1), nums[k -1] + f(k-2))
	nLen := len(nums)
	pre := 0
	cur := 0
	tmp := 0

	for idx := 0; idx < nLen; idx++ {
		if nums[idx]+pre > cur {
			tmp = nums[idx] + pre
		} else {
			tmp = cur
		}
		pre = cur
		cur = tmp
	}

	return cur
}

func rob2(nums []int) int {
	if len(nums) == 0 {
		return 0
	}

	// 动态规划问题，先定义子问题
	// 有n个房子，可以先划分成k个房子
	// 如果是k个房子找最大值，那么最后一个房子是k-1
	// 如果要偷最后一个房子，问题就变成了 f(k-1)
	// 如果不偷最后一个房子，问题就变成了 f(k-2)
	// 最后就变成了 Max(f(k-1), nums[k -1] + f(k-2))
	nLen := len(nums)
	beforeOne := 0
	beforeTwo := nums[0]
	end := beforeTwo

	for idx := 2; idx <= nLen; idx++ {
		if nums[idx-1]+beforeOne > beforeTwo {
			end = nums[idx-1] + beforeOne
		} else {
			end = beforeTwo
		}
		beforeOne, beforeTwo = beforeTwo, end
	}

	return end
}

func rob1(nums []int) int {
	if len(nums) == 0 {
		return 0
	}

	// 动态规划问题，先定义子问题
	// 有n个房子，可以先划分成k个房子
	// 如果是k个房子找最大值，那么最后一个房子是k-1
	// 如果要偷最后一个房子，问题就变成了 f(k-1)
	// 如果不偷最后一个房子，问题就变成了 f(k-2)
	// 最后就变成了 Max(f(k-1), nums[k -1] + f(k-2))
	nLen := len(nums)
	dp := make([]int, nLen+1)
	dp[0] = 0
	dp[1] = nums[0]

	for idx := 2; idx <= nLen; idx++ {
		if dp[idx-1] > nums[idx-1]+dp[idx-2] {
			dp[idx] = dp[idx-1]
		} else {
			dp[idx] = nums[idx-1] + dp[idx-2]
		}
	}

	return dp[nLen]
}

