func lengthOfLongestSubstring(s string) int {
	window := make(map[rune]int)
	runes := []rune(s)
	subLen, right, left := 0, 0, 0

	for _, ch := range s {
		window[ch]++
		right++
		for window[ch] > 1 {
			l := runes[left]
			left++
			window[l]--
		}
		if right-left > subLen {
			subLen = right - left
		}
	}
	return subLen
}

