type LRUCache struct {
	queue    []int
	cache    map[int]int
	capacity int
}

func Constructor(capacity int) LRUCache {
	return LRUCache{
		queue:    make([]int, 0, capacity),
		cache:    make(map[int]int),
		capacity: capacity,
	}
}

func (this *LRUCache) get(key int) int {
	ret, ok := this.cache[key]
	if ok {
		this.moveElemToEnd(key)
		return ret
	}
	return -1
}

func (this *LRUCache) moveElemToEnd(key int) {
	for idx, k := range this.queue {
		if k == key {
			this.queue = append(this.queue[0:idx], this.queue[idx+1:]...)
			break
		}
	}
	this.queue = append(this.queue, key)
}

func (this *LRUCache) put(key int, value int) {
	_, ok := this.cache[key]
	this.cache[key] = value
	if ok {
		this.moveElemToEnd(key)
		return
	}
	this.queue = append(this.queue, key)
	if len(this.queue) > this.capacity {
		delete(this.cache, this.queue[0])
		this.queue = this.queue[1:]
	}
}

