func checkIfPrerequisite1(numCourses int, prerequisites [][]int, queries [][]int) []bool {
	res := make([]bool, len(queries))
	// 构造一个图
	dependenies := make([][]int, numCourses)
	for idx := 0; idx < numCourses; idx++ {
		dependenies[idx] = make([]int, 0)
	}
	for _, dep := range prerequisites {
		from, to := dep[0], dep[1]
		dependenies[from] = append(dependenies[from], to)
	}
	for idx, query := range queries {
		from, to := query[0], query[1]
		queue := make([]int, 0)
		queue = append(queue, dependenies[from]...)
		exist := make(map[int]struct{})
		for len(queue) > 0 {
			dep := queue[0]
			exist[dep] = struct{}{}
			queue = queue[1:]
			if dep == to {
				res[idx] = true
				break
			}
			for _, dp := range dependenies[dep] {
				if _, ok := exist[dp]; ok {
					continue
				}
				queue = append(queue, dp)
			}
		}
	}

	return res
}

func checkIfPrerequisite2(numCourses int, prerequisites [][]int, queries [][]int) []bool {
	// 构造一个图
	dependencies := make([][]int, numCourses)
	dependencyCount := make([]int, numCourses)
	for idx := 0; idx < numCourses; idx++ {
		dependencies[idx] = make([]int, 0)
	}
	for _, dep := range prerequisites {
		from, to := dep[0], dep[1]
		dependencies[from] = append(dependencies[from], to)
		dependencyCount[to]++
	}

	arr := make([][]bool, numCourses)
	queue := make([]int, 0)
	for idx := 0; idx < numCourses; idx++ {
		if dependencyCount[idx] == 0 {
			queue = append(queue, idx)
		}
		arr[idx] = make([]bool, numCourses)
	}

	for len(queue) > 0 {
		cur := queue[0]
		queue = queue[1:]
		for _, next := range dependencies[cur] {
			arr[cur][next] = true
			for idx := 0; idx < numCourses; idx++ {
				arr[idx][next] = arr[idx][cur] || arr[idx][next]
			}
			dependencyCount[next]--
			if dependencyCount[next] == 0 {
				queue = append(queue, next)
			}
		}
	}

	res := make([]bool, len(queries))
	for idx, query := range queries {
		res[idx] = arr[query[0]][query[1]]
	}

	return res
}

func checkIfPrerequisite(numCourses int, prerequisites [][]int, queries [][]int) []bool {
	bitMap := make([][]bool, numCourses)
	for idx := range bitMap {
		bitMap[idx] = make([]bool, numCourses)
	}

	for _, pre := range prerequisites {
		from, to := pre[0], pre[1]
		bitMap[from][to] = true

		// 当前节点
		for idx := range bitMap {
			bitMap[idx][to] = bitMap[idx][from] || bitMap[idx][to]
		}

		// 子节点
		for idx := range bitMap {
			bitMap[from][idx] = bitMap[to][idx] || bitMap[from][idx]
		}
	}

	res := make([]bool, len(queries))
	for idx, query := range queries {
		res[idx] = bitMap[query[0]][query[1]]
	}
	return res
}

