func cycleLengthQueries1(n int, queries [][]int) []int {
	res := make([]int, len(queries))
	//完全二叉树，除2寻找公共祖先
	for idx, query := range queries {
		other, another := query[0], query[1]
		count := 1

		for other != another {
			if other > another {
				other /= 2
				count++
			}
			if another > other {
				another /= 2
				count++
			}
		}

		res[idx] = count
	}
	return res
}

