/*
挖掘完全二叉树的性质：节点编号的二进制的长度恰好等于节点深度。

以二进制下的 a=110, b=11101 为例：

算出两个节点的深度，分别为 3 和 5，深度之差 d=5−3=2，那么把 b 右移 d 位（相当于上跳 d 步），得到 111，这样 b 就和 a 在同一层了。
如果此时 a=b，说明 a 就是 LCA，答案为 d+1。
如果此时 a!=b，计算 a 异或 b 的结果 1，它的二进制长度为 L=1，那么 a 和 b 需要各上跳 L 步才能到达 LCA，答案为 d+2L+1。
*/
func cycleLengthQueries(n int, queries [][]int) []int {
	res := make([]int, len(queries))
	//完全二叉树，除2寻找公共祖先
	for idx, query := range queries {
		other, another := uint(query[0]), uint(query[1])
		if other > another {
			other, another = another, other
		}
		anotherBitLen := bits.Len(another)
		otherBitLen := bits.Len(other)
		d := anotherBitLen - otherBitLen
		res[idx] = d + bits.Len(another>>d^other)*2 + 1
	}
	return res
}

// 5=101 3=11
// d = 1
// L = 10^11 = 1
// d + 2L + 1 = 1 + 2 + 1
